create table empleado (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	ip_address VARCHAR(20)
);

create type empleado_type as (

nombre varchar,
apellido varchar,
email varchar,
valor integer

);

create or replace function return_empleado()
returns setof empleado_type

language plpgsql

as 

$$


declare 

valida integer;
registro RECORD;
rec empleado_type; 


cursor_tablas cursor is 
select * from empleado;

	begin 
	
		open cursor_tablas;
		fetch cursor_tablas into registro;
	
		while found loop
			begin 
				
				raise notice ' % ',registro.first_name;
				rec.nombre = registro.first_name;
				rec.apellido = registro.last_name;
				rec.email = registro.email;
				valida = length(registro.first_name);
			
				if valida>4 then 
					rec.valor = 100;
				else
					rec.valor = 1;
				end if;
			
			exception when others then 
				raise notice '% %',sqlerrm,sqlstate;
			end;
			return next rec;
			fetch cursor_tablas into registro;
		end loop;
		close cursor_tablas;
		return;
	end;
$$
;


select * from return_empleado()